from dataclasses import dataclass

@dataclass
class Triple:
    subject: str
    predicate: str
    object: str

# EVOLVE-BLOCK-START

def predict(triples: list[Triple]) -> str:
    if not triples:
        return ""

    sentence = ""
    subject = triples[0].subject

    sentence_parts = []
    for triple in triples:
        predicate = triple.predicate
        obj = triple.object

        if predicate == "architect":
            sentence_parts.append(f"designed by {obj}")
        elif predicate == "location":
            sentence_parts.append(f"located in {obj}")
        elif predicate == "completionDate":
            sentence_parts.append(f"completed in {obj}")
        elif predicate == "floorCount":
            sentence_parts.append(f"with {obj} floors")
        elif predicate == "cost":
            sentence_parts.append(f"costing {obj}")
        elif predicate == "buildingStartDate":
            sentence_parts.append(f"started construction in {obj}")
        else:
            sentence_parts.append(f"{predicate} {obj}")

    sentence = f"{subject} "
    for i, part in enumerate(sentence_parts):
        if i == 0:
            sentence += part
        else:
            sentence += f", {part}"
    sentence += "."

    return sentence + "."

